CREATE TABLE m_live_difficulty(
  live_difficulty_id INTEGER NOT NULL,
  live_id INTEGER NOT NULL,
  live_3d_asset_master_id INTEGER,
  live_difficulty_type INTEGER NOT NULL,
  unlock_pattern INTEGER NOT NULL,
  default_attribute INTEGER NOT NULL,
  target_voltage INTEGER NOT NULL,
  note_emit_msec INTEGER NOT NULL,
  recommended_score INTEGER NOT NULL,
  recommended_stamina INTEGER NOT NULL,
  consumed_lp INTEGER NOT NULL,
  reward_user_exp INTEGER NOT NULL,
  judge_id INTEGER NOT NULL,
  note_drop_group_id INTEGER NOT NULL,
  drop_choose_count INTEGER NOT NULL,
  rare_drop_rate INTEGER NOT NULL,
  drop_content_group_id INTEGER NOT NULL,
  rare_drop_content_group_id INTEGER NOT NULL,
  additional_drop_max_count INTEGER NOT NULL,
  additional_drop_content_group_id INTEGER NOT NULL,
  additional_rare_drop_content_group_id INTEGER NOT NULL,
  bottom_technique INTEGER NOT NULL,
  additional_drop_decay_technique INTEGER NOT NULL,
  reward_base_love_point INTEGER NOT NULL,
  evaluation_s_score INTEGER NOT NULL,
  evaluation_a_score INTEGER NOT NULL,
  evaluation_b_score INTEGER NOT NULL,
  evaluation_c_score INTEGER NOT NULL,
  updated_at INTEGER NOT NULL,
  lose_at_death INTEGER NOT NULL,
  autoplay_requirement_id INTEGER,
  skip_master_id INTEGER,
  stamina_voltage_group_id INTEGER NOT NULL,
  combo_voltage_group_id INTEGER NOT NULL,
  difficulty_const_master_id INTEGER NOT NULL,
  is_count_target INTEGER NOT NULL,
  PRIMARY KEY (live_difficulty_id),
  FOREIGN KEY (live_id) REFERENCES m_live(live_id),
  FOREIGN KEY (live_3d_asset_master_id) REFERENCES m_live_3d_asset(id),
  FOREIGN KEY (autoplay_requirement_id) REFERENCES m_live_autoplay_requirement(id),
  FOREIGN KEY (skip_master_id) REFERENCES m_live_skip_requirement(id),
  FOREIGN KEY (difficulty_const_master_id) REFERENCES m_live_difficulty_const(id)
);
